import styled from 'styled-components';

export const Container = styled.div`
    height: 64px;
    background: #333333;
    padding: 0 30px;
    height: 100px;
    flex-basis: 100%;
    border-bottom: 10px solid #FFC536;
`;

export const Logo = styled.img`
    width: 100%;
    height: auto;
    max-width: 150px;
`;
